import { render } from '@testing-library/react';
import React, { Component } from 'react';
import './App.css';
import pic from "./pic.jpg"



class App extends Component{


  state = {
    person: {
      fullName: "hager",
       bio: "about me",
       imgSrc: <img style={{maxWidth: '10vw'}} src={pic} alt ='pic' />,
       profession: "banker" ,
       }
      }

    change = () => {
      this.setState({
        age: 30,
      })(true)
    }


  render() {
    return (
      <div className="App">
        <p>{this.state.person.img}</p>
      </div>
    );
  }
}
export default App;
